import React from 'react';
import ReactDOM from 'react-dom';
import styles from './applicantInfo.module.css';

class ApplicantInfo extends React.Component {
	constructor(props){
		super(props);

	}
	render(){
		return(
		  <div className={styles.divEl}>
		    <p className={styles.textCss2}>{this.props.info.name}</p>
		    <p>{this.props.info.placeOfEmployment}</p>
		    <p className={styles.textCss1}>{this.props.info.addres}</p>
		    <img src="https://www.w3schools.com/images/w3schools_green.jpgg" alt="W3Schools.com"/>
		  </div>
		);
	}
} 

export default ApplicantInfo;
